import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

class Icon extends Component {
    render() {
        return (
            <div>
                <FontAwesomeIcon icon={['fas','music']}/>
            </div>
        );
    }
}

export default Icon;
